INSERT INTO `contenuti` VALUES (1,'hero_title','Aste Giudiziarie e Fallimentari: Assistenza Completa','testo','2026-02-01 10:56:29',NULL),(2,'hero_subtitle','Consulenza professionale, supporto legale e perizie per acquisti all\'asta in tutta Italia. Trova le migliori opportunità nella tua zona.','testo','2026-02-01 10:56:29',NULL),(3,'global_why_us_text','Siamo specializzati nell\'assistenza per {servizio} in {zona}. Il nostro team di professionisti garantisce:','testo','2026-02-01 10:56:29',NULL),(4,'global_benefits_html','<li><strong>Consulenza gratuita</strong>: valutazione preliminare senza impegno</li><li><strong>Esperti del settore</strong>: avvocati, periti e consulenti qualificati</li><li><strong>Supporto completo</strong>: dall\'analisi dell\'asta alla gestione post-acquisto</li><li><strong>Copertura nazionale</strong>: assistenza in tutta Italia</li><li><strong>Trasparenza totale</strong>: preventivi chiari e dettagliati</li>','html','2026-02-01 10:56:29',NULL);
