INSERT INTO `servizi` VALUES (1,'Auto all\'Asta','auto-allasta','veicoli','Acquista auto da aste giudiziarie e fallimentari. Assistenza completa per valutazione e acquisto.',NULL,NULL,NULL,'/assets/img/services/auto-all-asta.png',1,0,'Auto all\'Asta - Occasioni e Vendite Giudiziarie | Aste Giudiziarie 24','Trova le migliori auto all\'asta da fallimenti e procedure giudiziarie. Risparmia su berline, SUV e utilitarie con la nostra consulenza.'),(2,'Moto all\'Asta','moto-allasta','veicoli','Moto e scooter da aste giudiziarie. Supporto per perizie e documentazione.',NULL,NULL,NULL,'/assets/img/services/moto-all-asta.png',1,1,'Moto e Scooter all\'Asta - Occasioni Due Ruote | Aste Giudiziarie 24','Acquista moto e scooter all\'asta a prezzi vantaggiosi. Ampia scelta di motoveicoli da aste giudiziarie in tutta Italia.'),(3,'Barche all\'Asta','barche-allasta','veicoli','Imbarcazioni e natanti da aste fallimentari. Consulenza specializzata.',NULL,NULL,NULL,'/assets/img/services/barche-all-asta.png',1,2,'Barche e Yacht all\'Asta - Nautica Fallimentare | Aste Giudiziarie 24','Naviga nel risparmio con barche e yacht all\'asta. Occasioni uniche da fallimenti nautici e sequestri giudiziari.'),(4,'Case all\'Asta','case-allasta','immobili','Immobili residenziali da aste giudiziarie. Assistenza legale e perizie.',NULL,NULL,NULL,'/assets/img/services/case-all-asta.png',1,3,'Case e Appartamenti all\'Asta - Immobili Residenziali | Aste Giudiziarie 24','Cerchi casa? Scopri le aste immobiliari residenziali. Appartamenti, ville e monolocali all\'asta a prezzi inferiori al mercato.'),(5,'Aste Immobiliari','aste-immobiliari','immobili','Immobili commerciali, terreni e fabbricati da aste. Supporto completo.',NULL,NULL,NULL,'/assets/img/services/aste-immobiliari.png',1,4,'Aste Immobiliari - Investimenti Sicuri | Aste Giudiziarie 24','Tutte le aste immobiliari in Italia. Immobili residenziali, commerciali e industriali da procedure fallimentari.'),(6,'Aste Mobiliari','aste-mobiliari','altro','Beni mobili, macchinari e attrezzature da aste giudiziarie.',NULL,NULL,NULL,'/assets/img/services/aste-mobiliari.png',1,5,'Aste Mobiliari - Macchinari e Attrezzature | Aste Giudiziarie 24','Vendita di beni mobili, macchinari industriali, arredamento e attrezzature da fallimenti aziendali.'),(7,'Aste Giudiziarie','aste-giudiziarie','altro','Assistenza completa per tutte le tipologie di aste giudiziarie in Italia.',NULL,NULL,NULL,'/assets/img/services/aste-giudiziarie.png',1,6,'Consulenza Aste Giudiziarie - Esperti del Settore | Aste Giudiziarie 24','Servizi di consulenza professionale per aste giudiziarie. Assistenza legale e tecnica per partecipare alle aste in sicurezza.'),(8,'Aste Fallimentari','aste-fallimentari','altro','Opportunità da procedure fallimentari. Consulenza e supporto legale.',NULL,NULL,NULL,'/assets/img/services/aste-fallimentari.png',1,7,'Aste Fallimentari - Occasioni da Fallimenti | Aste Giudiziarie 24','Scopri le migliori opportunità dalle aste fallimentari italiane. Beni mobili e immobili a prezzi di liquidazione.'),(9,'Furgoni e Veicoli Commerciali all\'Asta','furgoni-veicoli-commerciali','veicoli','Aste giudiziarie di furgoni, camion, autocarri e veicoli commerciali. Mezzi da lavoro a prezzi d\'occasione da fallimenti.','',NULL,'<p><br></p>','/img/servizi/1770375708_furgoni-veicoli.webp',1,8,'Furgoni e Veicoli Commerciali all\'Asta - Occasioni Fallimentari','Trova furgoni, camion e veicoli commerciali all\'asta a prezzi vantaggiosi. Ampia selezione di mezzi da fallimenti e procedure giudiziarie in tutta Italia.'),(10,'Stock di Magazzino all\'Asta','stock-magazzino-all-asta','altro','Grandi lotti di merce, attrezzature e rimanenze di magazzino da fallimenti aziendali.','',NULL,'<p><br></p>','/img/servizi/1770376421_stock-magazzino.webp',1,9,'Stock di Magazzino e Rimanenze all\'Asta | Aste Giudiziarie 24','Acquista stock di magazzino e rimanenze varie da fallimenti. Lotti interi di merce a prezzi di liquidazione.'),(11,'Beni di Lusso all\'Asta','beni-lusso-all-asta','altro','Orologi, gioielli, opere d\'arte e beni preziosi provenienti da procedure esecutive.','',NULL,'<p><br></p>','/img/servizi/1770376194_beni-lusso.webp',1,10,'Beni di Lusso e Preziosi all\'Asta | Aste Giudiziarie 24','Orologi, gioielli, arte e beni di lusso all\'asta. Esclusività accessibile tramite vendite giudiziarie sicure.'),(12,'Crediti e Portafogli all\'Asta','crediti-portafogli-all-asta','altro','Acquisto di crediti deteriorati (NPL) e portafogli di crediti commerciali e finanziari.',NULL,NULL,NULL,'/assets/img/services/crediti-portafogli.png',1,11,'Cessione Crediti e Portafogli all\'Asta | Aste Giudiziarie 24','Investi in crediti deteriorati (NPL) e portafogli finanziari tramite aste giudiziarie. Consulenza specializzata.');
